function drawMap(to, scale, regions) {
	var cname='canvas_'+to;
	var style='';
	switch (scale) {
		case 'biller' : style='position:relative;top:-410px;left:-240px;z-index:0;';
			$('#'+to).append('<div id="'+cname+'" style="'+style+'"></div>');
			var rsr = Raphael(cname, 200, 200);
			break;

		case 1.0 : style='position:relative;top:-405px;left:-240px;z-index:0;';
			$('#'+to).append('<div id="'+cname+'" style="'+style+'"></div>');
			var rsr = Raphael(cname, 500, 500);
			break;

		case 2.0 : $('#'+to).append('<div id="'+cname+'" style="'+style+'"></div>');
			var rsr = Raphael(cname, 300, 300);
			break;

		case 3.0 : style='position:relative;top:-1150px;left:-730px;';
			$('#'+to).append('<div id="'+cname+'" style="'+style+'"></div>');
			var rsr = Raphael(cname, 1100, 1600);
			break;

/*
		case 4.0 : style='position:relative;top:-1150px;left:-730px;';
			$('#'+to).append('<div id="'+cname+'" style="'+style+'"></div>');
			var rsr = Raphael(cname, 2100, 2600);
			break;
*/

		default : break;
	}
	for (i=0;i<regions.length;i++) {
		switch (regions[i].region) {
			case 'NWJ' : draw_NWJ(rsr, regions[i].color, scale); break;
			case 'NEJ' : draw_NEJ(rsr, regions[i].color, scale); break;
			case 'EJ' : draw_EJ(rsr, regions[i].color, scale); break;
			case 'WJ' : draw_WJ(rsr, regions[i].color, scale); break;
			case 'SJ' : draw_SJ(rsr, regions[i].color, scale); break;
			case 'F' : draw_F(rsr, regions[i].color, scale); break;
			case 'LFM' : draw_LFM(rsr, regions[i].color, scale); break;
			case 'SZ' : draw_SZ(rsr, regions[i].color, scale); break;
			case 'NEZ' : draw_NEZ(rsr, regions[i].color, scale); break;
			case 'NWZ' : draw_NWZ(rsr, regions[i].color, scale); break;
			case 'B' : draw_B(rsr, regions[i].color, scale); break;

			default : break;
		}
	}
	switch (scale) {
		case 1.0 : $('#'+cname).width(100);
				$('#'+cname).height(50);
			break;
		default : break;
	}

}

