function sc(path, scale) {
	if (scale==1.0) return;
 	var cx=0; var cy=0;
	switch (scale) {
		case 1.0 : cx=65; cy=-550; break;
		case 2.0 : cx=465; cy=750; break;
		default : break;
	}
	var transform="s"+scale+", "+scale+", "+cx+", "+cy;
	path.transform(transform);
}
